INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `singleSRC`, `alt`, `title`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `shClass`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `posterSRC`, `playerSize`, `autoplay`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `space`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES (3,1,'tl_article',128,1456296773,'text','a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:0:\"\";}','<section>\n<h1>Virmisco — The Virtual Microscope Slide Collection</h1>\n<h1>Digitisation – The formation of a virtual research infrastructure</h1>\n<p>Digitisation allows science rapid access to research objects while conserving the originals. The linkage of diverse online resources creates a virtual research infrastructure that provides completely novel opportunities for science.</p>\n<p>To optimise their use in research and to ensure comparability, digitised materials should be produced under the same conditions (for instance with respect to resolution and colour fidelity). This requires the definition of precise standards for digitisation.</p>\n<p>For two-dimensional objects such as drawings, photographs, texts and prints, long-lasting experience and comprehensive standards already exist (links). For three-dimensional objects the definition of standards is still in its initial stages.</p>\n<h2>The digitisation of three-dimensional microscopic objects</h2>\n<p><img style=\"float: right;\" src=\"http://www.senckenberg.de/images/content/forschung/abteilung/bodenzoologie/arachnida/bild_fur_website_z-stapel.png\" alt=\"Z-Stapel\"></p>\n<p>For the digitisation of three-dimensional microscopic objects (in contrast to thin-sections) several techniques come into consideration: optical sectioning in bright-field microscopy, laser confocal microscopy or nanoCT. Since most of the materials in question are permanently mounted objects on slides, nanoCT can – aside from its high costs – be excluded at the moment. Laser confocal microscopy leads to images that lay beyond the normal experience of the biologist dealing with complete organisms. We therefore chose the first mentioned technique producing stacks of optical sections (z-stacks) with a bright-field microscope (for details on the imaging chain and our standards read here). It is a technique which up to now is widely used and easy to realise.</p>\n<h2>The creation of a Virtual Microscope</h2>\n<p>The transfer of large data volumes via the internet is a challenge. We use video compression techniques in order to maintain image quality as well as possible. This enables the user to focus online through the object as if using a real microscope. Additionally, single images can be manipulated and complete z-stacks downloaded as jpeg files.</p>\n<h2>The benefits of Virmisco</h2>\n<p>Virmisco offers virtual access to collections, esp. type material. Loans might become obsolete in many cases, conserving material from damage and loss.</p>\n<p>Virmisco opens new ways for taxonomic publishing. Instead of producing drawings, which is very time consuming, the deposition of z-stacks in Virmsico additionally to the printed text will be a more realistic and inter-subjective representation of the objects described.</p>\n<p>Virmisco can be used for education and taxonomic training since it constitutes a virtual reference collection.</p>\n</section>','',0x9CC5247F979011E5AF7E8E0F651ACB6C,'','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','right',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(4,2,'tl_article',128,1456295647,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<section>\n<blockquote>\n<h4>Das Internet als Forschungs-Infrastruktur</h4>\n<p>Seit Jahren gibt es in vielen Ländern Bestrebungen, Sammlungs-Objekte aus Museen und Bibliotheken zu digitalisieren und im Internet verfügbar zu machen. Durch diese Digitalisierung wird der Forschung der schnelle Zugang zu den Objekten ermöglicht und die Originale werden geschont. Die Vernetzung der unterschiedlichsten online verfügbaren Ressourcen schafft eine Forschungs-Infrastruktur, die der Wissenschaft ganz neue Möglichkeiten eröffnet.</p>\n<h4>Erkenntnisgewinn durch Vergleichen</h4>\n<p>Bis heute gewinnt die Wissenschaft viele ihrer Erkenntnisse durch den direkten Vergleich von Objekten. Für die Nutzung der digitalen Abbilder der Objekte in der Forschung müssen die Digitalisate unter den gleichen Bedingungen (z. B. im Hinblick auf Farbtreue und Auflösung) hergestellt worden sein. Das erfordert die Festlegung klarer Standards für die Digitalisierung.</p>\n<p>Für zweidimensionale Objekte wie Texte, Drucke, Fotografien usw. werden von der Deutschen Forschungsgemeinschaft bereits umfangreiche Standards vorgegeben (DFG-Praxisregeln „Digitalisierung“ 02/2013).</p>\n<p>Fü</p>\n<p>r dreidimensionale Objekte befindet sich diese Entwicklung noch im Anfangsstadium. Deshalb hat die DFG Projekte bewilligt, um auch für dreidimensionale Objekte Standards zur Digitalisierung zu entwickeln.</p>\n<h4>Schnelles Auffinden der Digitalisate im Netz</h4>\n<p>Bilder sind im Internet direkt nicht recherchierbar. Es bedarf Namen oder Beschreibung</p>\n<p>en der Digitalisate, um sie zu finden. Für diese über die eigentliche Bildinformation h</p>\n<p>inausgehende Zusatzinformation, die Metadaten (z. B. Tiername, Fundort, Art der Präparation), sollten standardisierte Begriffe genutzt werden, um den Zugriff auf die</p>\n<p>Digitalisate zu erleichtern. In der Biologie bietet der Darwin Core ein solches standardisiertes Vokabular.</p>\n<p>Original-Objekte bleiben trotzdem unverzichtbar</p>\n<p>Obwohl Digitalisate in Zukunft Forschungsarbeiten erleichtern werden, bleiben die Original-Objekte unverzichtbar, da nie alle Aspekte digital erfasst sind. Die Digitalisierung wirkt aber schonend auf die wertvollen wissenschaftliche Objekte und erweitert die Sicherheit der Kenntnisse für den Fall des Totalverlustes des Originals.</p>\n<h4>Der Beitrag des Senckenberg Museums für Naturkunde Görlitz</h4>\n<p>Ein Sammlungsschwerpunkt am Senckenberg Museum für Naturkunde Görlitz sind kleine Bodentiere, wie Milben, Springschwänze und Fadenwürmer, die häufig permanent auf</p>\n<p>[nbsp]</p>\n<p>Objektträger montiert sind, um sie mit dem Lichtmikroskop betrachten zu können. Ziel unseres Projektes ist es, für Präparate dieser Bodentiere Digitalisierungs-Methoden und -Standards zu entwickeln. Die Objekte sollen im Internet so zugänglich gemacht werden, als würde ein Wissenschaftler sie unmittelbar in seinem Mikroskop sehen. Dazu werden Foto-Serien (Fokusserien) hergestellt, die online betrachtet oder heruntergeladen werden können. Weiterhin sollen neuere lichtmikroskopische Abbildungs-Verfahren auf ihre Tauglichkeit für die Herstellung von Digitalisaten getestet und die Metadaten-Standards für diese Objektgattung weiterentwickelt werden. Das Ziel besteht darin, ein „virtuelles Internet-Mikroskop“ zu entwickeln!</p>\n</blockquote>\n</section>','',0x0692F1E7998911E5AF7E8E0F651ACB6C,'xxx','xxx','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:13:\"center_center\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','files/virmisco-theme/img/Actinedida_2002.png','','','below',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(19,14,'tl_article',128,1458039003,'text','a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:0:\"\";}','<section>\n<h1><img src=\"{{file::adca2812-9790-11e5-af7e-8e0f651acb6c}}\" alt=\"\" width=\"125\" height=\"161\"></h1>\n<h1>Virmisco — The Virtual Microscope Slide Collection</h1>\n<h1>Digitisation – The formation of a virtual research infrastructure</h1>\n<p>Digitisation allows science rapid access to research objects while conserving the originals. The linkage of diverse online resources creates a virtual research infrastructure that provides completely novel opportunities for science.</p>\n<p>To optimise their use in research and to ensure comparability, digitised materials should be produced under the same conditions (for instance with respect to resolution and colour fidelity). This requires the definition of precise standards for digitisation.</p>\n<p>For two-dimensional objects such as drawings, photographs, texts and prints, long-lasting experience and comprehensive standards already exist (links). For three-dimensional objects the definition of standards is still in its initial stages.</p>\n<h2>The digitisation of three-dimensional microscopic objects</h2>\n<p><img style=\"float: right;\" src=\"http://www.senckenberg.de/images/content/forschung/abteilung/bodenzoologie/arachnida/bild_fur_website_z-stapel.png\" alt=\"Z-Stapel\"></p>\n<p>For the digitisation of three-dimensional microscopic objects (in contrast to thin-sections) several techniques come into consideration: optical sectioning in bright-field microscopy, laser confocal microscopy or nanoCT. Since most of the materials in question are permanently mounted objects on slides, nanoCT can – aside from its high costs – be excluded at the moment. Laser confocal microscopy leads to images that lay beyond the normal experience of the biologist dealing with complete organisms. We therefore chose the first mentioned technique producing stacks of optical sections (z-stacks) with a bright-field microscope (for details on the imaging chain and our standards read here). It is a technique which up to now is widely used and easy to realise.</p>\n<h2>The creation of a Virtual Microscope</h2>\n<p>The transfer of large data volumes via the internet is a challenge. We use video compression techniques in order to maintain image quality as well as possible. This enables the user to focus online through the object as if using a real microscope. Additionally, single images can be manipulated and complete z-stacks downloaded as jpeg files.</p>\n<h2>The benefits of Virmisco</h2>\n<p>Virmisco offers virtual access to collections, esp. type material. Loans might become obsolete in many cases, conserving material from damage and loss.</p>\n<p>Virmisco opens new ways for taxonomic publishing. Instead of producing drawings, which is very time consuming, the deposition of z-stacks in Virmsico additionally to the printed text will be a more realistic and inter-subjective representation of the objects described.</p>\n<p>Virmisco can be used for education and taxonomic training since it constitutes a virtual reference collection.</p>\n</section>','',0x9CC5247F979011E5AF7E8E0F651ACB6C,'','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','right',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','',