Optics 33,4: 641-653</p>\n<p style=\"text-align: justify;\"><strong>B</strong>OREMAN, GLENN D. (2001): <em>Modulation Transfer Function in Optical and Electro-Optical Systems</em>. - SPIE Press, Bellingham, Washington USA</p>\n<p style=\"text-align: justify;\">BOYER, G., SARAFIS, V. (2001): <em>Two pinhole superresolution using spatial filters</em>. - Optik International Journal for Light and Electron Optics 112,4: 177-179</p>\n<p style=\"text-align: justify;\"><strong>C</strong>AMPBELL, SCOTT P. (2000): <em>Use of a Nyquist chart for camera system evaluation.</em> - Proceeding SPIE, the international society for optical engineering 3965: 230-234</p>\n<p style=\"text-align: justify;\">COGSWELL, C.J., SHEPPARD, C.J.R. (1992): <em>Confocal differential interference contrast (DIC) microscopy: including a theoretical analysis of conventional and confocal DIC imaging</em>. - Journal of Microscopy; Wiley-Blackwell 165,1: 81-101</p>\n<p style=\"text-align: justify;\">CUNNINGHAM, I.A., FENSTER, A. (1987): <em>A Method for modulation transfer function determination from edge profiles with correction for finite-element differentiation</em>. - Am. Assoc. Phys. Med. 14,4: 533-537</p>\n<p style=\"text-align: justify;\"><strong>E</strong>CKERT, M.P., BRADLEY, A.P. (1998):<em> Perceptual Quality Metrics Applied to Still Image Compression</em>. – Elsevier 70: 177-200</p>\n<p style=\"text-align: justify;\"><strong>F</strong>IETE, ROBERT D. (2010): <em>Modeling the Imaging Chain of Digital Camera</em>s. - SPIE Press, Bellingham, Washington USA</p>\n<p style=\"text-align: justify;\">FRIEDEN, B.R. (1967): <em>Optical Transfer of the Three-Dimensional Object</em>. - Journal of the Optical Society of America 57,1: 56-65</p>\n<p style=\"text-align: justify;\"><strong>G</strong>OLDBERG, I.G. et al. (2005): <em>The Open Microscopy Environment (OME) Data Model and XML file: open tools for informatics and quantitative analysis in biological imaging</em>. - Genome Biology 6,5 (article R47)</p>\n<p style=\"text-align: justify;\">GUTTOSCH, R.J. (1998-2005): <em>Investigation of Color Aliasing of High Spatial Frequencies and Edges for Bayer-Pattern Sensors and Foveon X3® Direct Image Sensors.</em> – Foveon, Inc. Santa Clara, CA</p>\n<p style=\"text-align: justify;\"><strong>H</strong>ORIKAWA, Y., YAMAMOTO, M., DOSAKA, S. (1987): <em>Laser scanning microscope: Differential phase images</em>. - Journal of Microscopy; Wiley-Blackwell 148,1: 1-10</p>\n<p style=\"text-align: justify;\"><strong>L</strong>ANG, WALTHER (1968-1982): <em>Nomarski differential interference-contrast microscopy Teil 1-4</em>. – Carl Zeiss, Oberkochen</p>\n<p style=\"text-align: justify;\">LIN, W., KUO, C.-C. JAY (2011): <em>Perceptual visual quality metrics- A survey</em>. – Elsevier 22,4: 297-312</p>\n<p style=\"text-align: justify;\"><strong>M</strong>IKULA, S., TROTTS, I., STONE, J.M., JONES, E.G. (2007): <em>Internet-Enabled High-Resolution Brain Mapping and Virtual Microscopy</em>. - Neuroimage; Elsevier 35,1: 9-15</p>\n<p style=\"text-align: justify;\"><strong>O</strong>GILVIE, R.W., GU, JIANG (2005): <em>Virtual Microscopy and Virtual Slides in Teaching, Diagnosis, and Research</em>. - CRC Press</p>\n<p style=\"text-align: justify;\"><strong>P</strong>ARK, S.K., SCHOWENGERDT, R., KACZYNSKI, M.-A. (1984): <em>Modulation-transfer-function analysis for sampled image systems.</em>- Applied Optics 23,15: 2572-2582</p>\n<p style=\"text-align: justify;\">PAWLAY, JAMES (2006): <em>Handbook of Biological Confocal Microscopy</em>. – Springer</p>\n<p style=\"text-align: justify;\">PLUTA, M. (1990): <em>Advanced Light Microscopy: Specialized Methods.</em> - Journal of Microscopy; Wiley-Blackwell 158,3: 416ff.</p>\n<p style=\"text-align: justify;\">PREZA, C., SNYDER, DONALD L., CONCHELLO; JOSÉ-ANGEL (1999): <em>Theoretical Development and Experimental Evaluation of Imaging Models for Differential Interference Contrast Microscopy</em>. -Journal of the optical society of America A 16,9: 2185-2199</p>\n<p style=\"text-align: justify;\"><strong>S</strong>OMEKH, M.G., VALERA, M.S., APPEL, R.K. (1992):<em> Confocal scanning optical microscope for imaging weak amplitude and phase objects</em>. - Proceeding SPIE, the international society for optical engineering 1647: 28-38</p>\n<p style=\"text-align: justify;\">STELZER, E.H.K., MARSMAN, H.J.B., WIJNAENTS VAN RESANDT. R.W. (1986): <em>A Setup for a confocal scanning laser interference microscope</em>. – Optik 73,1: 30-33</p>\n<p style=\"text-align: justify;\"><strong>T</strong>RUSSEL, H.J., HARTWIG, R.E. (2002): <em>Mathematics for demosaicing.</em> - IEEE Transaction on image processing 11,4: 485-492</p>\n<p style=\"text-align: justify;\"><strong>V</strong>OLLMERHAUSEN, R.H., REAGO, D.A., DRIGGERS, R.G. (2010): <em>Analysis and Evaluation of Sampled Imaging Systems</em>. - Spie Press Book</p>\n<p style=\"text-align: justify;\"><strong>W</strong>ANG, Z., SIMONCELLI E.P., BOVIK, A.C. (2003): <em>Multi-Scale Structural Similarity for Image Quality Assessment</em>. – Proceedings of the 37th IEEE Asilomar Conference on Signals, Systems and Computers, Pacific Grove, CA[nbsp] Vol. 2: 1398-1402</p>\n<p style=\"text-align: justify;\">WANG, Z., LIGANG, LU, BOVIK, A. C. (2004): <em>Video Quality Assessment Based on Structural Distortion Measurement</em>. – Elsevier 19,2: 121-132</p>\n<p style=\"text-align: justify;\">WANG; Z., BOVIK, A.C., SHEIKH, H.R., SIMONCELLI, E.P. (2004): <em>Image Quality Assessment: From Error Visibility to Structural Similarity</em>. - [nbsp]IEEE Transaction on image processing 13,4: 600-612</p>\n<p style=\"text-align: justify;\">WEBB, ROBERT H. (1996): <em>Confocal optical microscopy</em>. - Reports on Progress in Physics 59: 427-471</p>\n<p style=\"text-align: justify;\">WILLIAMS, C.S., BECKLUND, O.A. (2002): <em>Introduction to the Optical Transfer Function</em>. - SPIE Press, Bellingham, Washington USA</p>\n<p style=\"text-align: justify;\">WILSON, T., CARLINI, A.R., SHEPPARD, C.J.R. (1985): <em>Phase contrast microscopy by nearly full illumination</em>. – Optik 70: 166-169</p>\n<p style=\"text-align: justify;\">WILSON, T., JUSKAITIS, R., TAN, J.B. (1994): <em>Differential imaging in confocal microscopy</em>. - Journal of Microscopy; Wiley-Blackwell 175,1: 1-9</p>\n<p style=\"text-align: justify;\">[nbsp]</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','',0,'','','','','');
