INSERT INTO `tl_search` (`id`, `pid`, `tstamp`, `title`, `url`, `text`, `filesize`, `checksum`, `protected`, `groups`, `language`) VALUES (1,3,1460040157,'Home','','Home Links Senckenberg LIS DFG Virmisco — The Virtual Microscope Slide Collection Digitisation – The formation of a virtual research infrastructure Digitisation allows science rapid access to research objects while conserving the originals. The linkage of diverse online resources creates a virtual research infrastructure that provides completely novel opportunities for science. To optimise their use in research and to ensure comparability, digitised materials should be produced under the same conditions (for instance with respect to resolution and colour fidelity). This requires the definition of precise standards for digitisation. For two-dimensional objects such as drawings, photographs, texts and prints, long-lasting experience and comprehensive standards already exist (links). For three-dimensional objects the definition of standards is still in its initial stages. The digitisation of three-dimensional microscopic objects For the digitisation of three-dimensional microscopic objects (in contrast to thin-sections) several techniques come into consideration: optical sectioning in bright-field microscopy, laser confocal microscopy or nanoCT. Since most of the materials in question are permanently mounted objects on slides, nanoCT can – aside from its high costs – be excluded at the moment. Laser confocal microscopy leads to images that lay beyond the normal experience of the biologist dealing with complete organisms. We therefore chose the first mentioned technique producing stacks of optical sections (z-stacks) with a bright-field microscope (for details on the imaging chain and our standards read here). It is a technique which up to now is widely used and easy to realise. The creation of a Virtual Microscope The transfer of large data volumes via the internet is a challenge. We use video compression techniques in order to maintain image quality as well as possible. This enables the user to focus online through the object as if using a real microscope. Additionally, single images can be manipulated and complete z-stacks downloaded as jpeg files. The benefits of Virmisco Virmisco offers virtual access to collections, esp. type material. Loans might become obsolete in many cases, conserving material from damage and loss. Virmisco opens new ways for taxonomic publishing. Instead of producing drawings, which is very time consuming, the deposition of z-stacks in Virmsico additionally to the printed text will be a more realistic and inter-subjective representation of the objects described. Virmisco can be used for education and taxonomic training since it constitutes a virtual reference collection. Senckenberg | Contact | Terms & Conditions Z-Stapel',6.9,'2117ac2da4621410fb05df03b7f534d7','',0x30,'en'),(2,5,1460306701,'Contact','index.php/contact.html','Contact Links Senckenberg LIS DFG Contact Postal Address Senckenberg Museum of Natural History Görlitz Section Arachnida P.O. Box 30 01 54 02806 Görlitz GERMANY Visitors Address: Senckenberg Museum of Natural History Görlitz Section Arachnida Sonnenstr. 7 02826 Görlitz GERMANY See also For direct contact to a representative, see: About us Senckenberg | Contact | Terms & Conditions',6.98,'50dcbb5571137d71695cc8c7d7c43344','',0x30,'en'),(3,7,1460359964,'Terms and Conditions','index.php/terms-and-conditions.html','Terms and Conditions Links Senckenberg LIS DFG Provider responsible as defined in §5 TMG (Broadcast Media Act): Senckenberg Museum of Natural History Görlitz Section Arachnida P.O. Box 30 01 54 02806 Görlitz GERMANY Terms and Conditions The project Virmisco reserves the right not to be responsible for the topicality, correctness, and completeness or quality of the information provided. Liability claims regarding damage caused by the use of any information provided, including any kind of information, which is incomplete or incorrect, will therefore be rejected. All offers are not binding and without obligation. Parts of the pages or the complete publication including all offers and information might be extended, changed partly or completely deleted by Virmisco without separate announcement. Referrals and links The project Virmisco is not responsible for any contents linked or referred to from its pages – unless it has full knowledge of illegal contents and would be able to prevent the visitors of its site from viewing those pages-. If any damage occurs by the use of information presented there, only the author of the respective pages might be liable, not the one who has linked to these pages. Furthermore Virmisco is not liable for any postings or messages published by users of discussion boards, guestbook or mailing lists provided on his page. Copyright The project Virmisco intends not to use any copyrighted material for the publication or, if not possible, to indicate the copyright of the respective object. The copyright for any material created by Virmisco is reserved. Any duplication or use of objects such as images, diagrams, sounds or texts in other electronic or printed publications is not permitted without the Virmisco agreement. Privacy policy If the opportunity for the input of personal or business data (email addresses, name, addresses) is given, the input of these data takes place voluntarily. The use and payment of all offered services are permitted – if and so far technically possible and reasonable – without specification of any personal data or under specification of anonymized data or an alias. The use of published postal addresses, telephone or fax numbers and email addresses for marketing purposes is prohibited, offenders sending unwanted spam messages will be punished. Legal validity of this disclaimer This disclaimer is to be regarded as part of the Internet publication which you were referred from. If sections or individual terms of this statement are not legal or correct, the content or validity of the other parts remain uninfluenced by this fact. Senckenberg | Contact | Terms & Conditions',6.77,'97aee6ff32cdafba95bf87833a45701f','',0x30,'en'),(4,4,1460306684,'Publication','index.php/publication.html','Publication Links Senckenberg LIS DFG Das Internet als Forschungs-Infrastruktur Seit Jahren gibt es in vielen Ländern Bestrebungen, Sammlungs-Objekte aus Museen und Bibliotheken zu digitalisieren und im Internet verfügbar zu machen. Durch diese Digitalisierung wird der Forschung der schnelle Zugang zu den Objekten ermöglicht und die Originale werden geschont. Die Vernetzung der unterschiedlichsten online verfügbaren Ressourcen schafft eine Forschungs-Infrastruktur, die der Wissenschaft ganz neue Möglichkeiten eröffnet. Erkenntnisgewinn durch Vergleichen Bis heute gewinnt die Wissenschaft viele ihrer Erkenntnisse durch den direkten Vergleich von Objekten. Für die Nutzung der digitalen Abbilder der Objekte in der Forschung müssen die Digitalisate unter den gleichen Bedingungen (z. B. im Hinblick auf Farbtreue und Auflösung) hergestellt worden sein. Das erfordert die Festlegung klarer Standards für die Digitalisierung. Für zweidimensionale Objekte wie Texte, Drucke, Fotografien usw. werden von der Deutschen Forschungsgemeinschaft bereits umfangreiche Standards vorgegeben (DFG-Praxisregeln „Digitalisierung“ 02/2013). Fü r dreidimensionale Objekte befindet sich diese Entwicklung noch im Anfangsstadium. Deshalb hat die DFG Projekte bewilligt, um auch für dreidimensionale Objekte Standards zur Digitalisierung zu entwickeln. Schnelles Auffinden der Digitalisate im Netz Bilder sind im Internet direkt nicht recherchierbar. Es bedarf Namen oder Beschreibung en der Digitalisate, um sie zu finden. Für diese über die eigentliche Bildinformation h inausgehende Zusatzinformation, die Metadaten (z. B. Tiername, Fundort, Art der Präparation), sollten standardisierte Begriffe genutzt werden, um den Zugriff auf die Digitalisate zu erleichtern. In der Biologie bietet der Darwin Core ein solches standardisiertes Vokabular. Original-Objekte bleiben trotzdem unverzichtbar Obwohl Digitalisate in Zukunft Forschungsarbeiten erleichtern werden, bleiben die Original-Objekte unverzichtbar, da nie alle Aspekte digital erfasst sind. Die Digitalisierung wirkt aber schonend auf die wertvollen wissenschaftliche Objekte und erweitert die Sicherheit der Kenntnisse für den Fall des Totalverlustes des Originals. Der Beitrag des Senckenberg Museums für Naturkunde Görlitz Ein Sammlungsschwerpunkt am Senckenberg Museum für Naturkunde Görlitz sind kleine Bodentiere, wie Milben, Springschwänze und Fadenwürmer, die häufig permanent auf Objektträger montiert sind, um sie mit dem Lichtmikroskop betrachten zu können. Ziel unseres Projektes ist es, für Präparate dieser Bodentiere Digitalisierungs-Methoden und -Standards zu entwickeln. Die Objekte sollen im Internet so zugänglich gemacht werden, als würde ein Wissenschaftler sie unmittelbar in seinem Mikroskop sehen. Dazu werden Foto-Serien (Fokusserien) hergestellt, die online betrachtet oder heruntergeladen werden können. Weiterhin sollen neuere lichtmikroskopische Abbildungs-Verfahren auf ihre Tauglichkeit für die Herstellung von Digitalisaten getestet und die Metadaten-Standards für diese Objektgattung weiterentwickelt werden. Das Ziel besteht darin, ein „virtuelles Internet-Mikroskop“ zu entwickeln! Senckenberg | Contact | Terms & Conditions',7.31,'ff9798d9505c9f8e06d5bbf09d1a71e5','',0x30,'en'),(5,6,1460306714,'About us','index.php/about-us.html','About us Links Senckenberg LIS DFG About us Representatives Dr Axel Christian Head of section Head of museum and scientific-technical services Phone: +49-3581-4760-5201 Mail: axel.christian@senckenberg.de Dr Eberhard Wurst Project manager Phone: +49-3581-4760-5590 Mail: eberhard.wurst@senckenberg.de Senckenberg | Contact | Terms & Conditions Picture of Dr Axel Christian, Picture of Dr Eberhard Wurst',5.06,'99f3de50628d0e7c27ad919378883b61','',0x30,'en'),(6,10,1460306728,'Searchtest','index.php/searchtest.html','Searchtest Links Senckenberg LIS DFG Search for digital photomicrographs Full-text search Enter one or multiple words to gain results matching as many of them as possible. Senckenberg | Contact | Terms & Conditions',4.49,'a6f1fb3fb01413a51ad7bd7599fa9e35','',0x30,'en'),(9,12,1448985193,'Resulttest','index.php/resulttest.html?search=','Resulttest virmisco The virtual microscope slide collection of the Senckenberg Museum of Natural History Görlitz. Links Senckenberg LIS DFG Array ( [search] => ) Senckenberg | Contact | Terms & Conditions',3.66,'de5d4ab733b30bdff407057920ca6b0d','',0x30,'en'),(10,12,1448980635,'Resulttest','index.php/resulttest.html?search=dsf','Resulttest virmisco The virtual microscope slide collection of the Senckenberg Museum of Natural History Görlitz. Links Senckenberg LIS DFG Array ( [search] => dsf ) Senckenberg | Contact | Terms & Conditions',3.67,'5d842a3e5a9af4c3692e418b83ae253b','',0x30,'en'),(11,3,1460306747,'Home','index.php/home.html','Home Links Senckenberg LIS DFG Virmisco — The Virtual Microscope Slide Collection Digitisation – The formation of a virtual research infrastructure Digitisation allows science rapid access to research objects while conserving the originals. The linkage of diverse online resources creates a virtual research infrastructure that provides completely novel opportunities for science. To optimise their use in research and to ensure comparability, digitised materials should be produced under the same conditions (for instance with respect to resolution and colour fidelity). This requires the definition of precise standards for digitisation. For two-dimensional objects such as drawings, photographs, texts and prints, long-lasting experience and comprehensive standards already exist (links). For three-dimensional objects the definition of standards is still in its initial stages. The digitisation of three-dimensional microscopic objects For the digitisation of three-dimensional microscopic objects (in contrast to thin-sections) several techniques come into consideration: optical sectioning in bright-field microscopy, laser confocal microscopy or nanoCT. Since most of the materials in question are permanently mounted objects on slides, nanoCT can – aside from its high costs – be excluded at the moment. Laser confocal microscopy leads to images that lay beyond the normal experience of the biologist dealing with complete organisms. We therefore chose the first mentioned technique producing stacks of optical sections (z-stacks) with a bright-field microscope (for details on the imaging chain and our standards read here). It is a technique which up to now is widely used and easy to realise. The creation of a Virtual Microscope The transfer of large data volumes via the internet is a challenge. We use video compression techniques in order to maintain image quality as well as possible. This enables the user to focus online through the object as if using a real microscope. Additionally, single images can be manipulated and complete z-stacks downloaded as jpeg files. The benefits of Virmisco Virmisco offers virtual access to collections, esp. type material. Loans might become obsolete in many cases, conserving material from damage and loss. Virmisco opens new ways for taxonomic publishing. Instead of producing drawings, which is very time consuming, the deposition of z-stacks in Virmsico additionally to the printed text will be a more realistic and inter-subjective representation of the objects described. Virmisco can be used for education and taxonomic training since it constitutes a virtual reference collection. Senckenberg | Contact | Terms & Conditions Z-Stapel',6.87,'2117ac2da4621410fb05df03b7f534d7','',0x30,'en'),(13,17,1460306739,'literature','index.php/literature.html','literature Links Senckenberg LIS DFG Literature AMOS, W.B., RESCHELT, S., CATTERMOLE, D.M., LAUFER, I. (2003): Re-evaluation 